import React from 'react';
import { motion } from 'framer-motion';
import './App.css';
import logo from './assets/logo.png';
import leaf from './assets/leaf.png';
import mobileDuo from './assets/mobile_duo1.png';

function App() {
  return (
    <div className="app">
      {/* First Section */}
      <motion.section
        className="hero-section"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <div className="header">
          <img src={logo} alt="Logo" className="logo" />
          <button className="demo-button">Request Demo</button>
        </div>
        <div className="content">
          <h1>
            Creativity
            <br />
            <span>Beyond Limits</span>
          </h1>
        </div>
        <img src={leaf} alt="Background Leaf" className="background-leaf" />
      </motion.section>

      {/* Second Section */}
      <motion.section
        className="info-section"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <p className="info-text">
          Pigeon Post is built for boundless. For creators who want to break through barriers
        </p>
      </motion.section>

      {/* Third Section */}
      <motion.section
        className="platform-section"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <h1 className="platform-heading">
          One Platform
          <br />
          <span>Infinite Potential</span>
        </h1>
      </motion.section>

      {/* Fourth Section */}
      <motion.section
        className="create-section"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <p className="create-text">
          Everything you need, together in one place. No friction, no barriersâ€”just the space to <span className="highlight">create</span> your best work.
        </p>
      </motion.section>

      {/* Fifth Section */}
      <motion.section
        className="new-era-section"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <h1 className="new-era-heading">
          <span className="small-text">Not Just a Platform</span>
          <br />
          A New Era
        </h1>
      </motion.section>

      {/* Sixth Section */}
      <motion.section
        className="next-gen-section"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <div className="text-container">
          <p className="subtitle">A place where creators write the future, together;</p>
          <h1 className="main-title">Welcome to the next generation of creativity</h1>
        </div>
        <motion.div
          className="image-container"
          initial={{ opacity: 0, y: 100 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <img src={mobileDuo} alt="Mobile Duo" className="mobile-image" />
        </motion.div>
      </motion.section>
    </div>
  );
}

export default App;
